import React from "react";
import MenuItem from "./MenuItem";

function MenuList({ menus }) {
  return (
    <div>
      {menus.map((note) => (
        <MenuItem key={note.id} id={note.id} {...note} />
      ))}
    </div>
  );
}

export default MenuList;
